/*Funcion para convertir caracteres a hexadecimal de un byte*/
int Char_to_Hex(char char1, char char2){

    /*Es un numero*/
    if((char1 >= '0') && (char1 <= '9')){
        char1 = char1 - '0';
    }
    /*Es una letra entre la A y la F*/
    else if((char1 >= 'A') && (char1 <= 'F')){
        char1 = char1 - 'A' + 10;
    }


    /*Es un numero*/
    if((char2 >= '0') && (char2 <= '9')){
        char2 = char2 - '0';
    }
    /*Es una letra entre la A y la F*/
    else if((char2 >= 'A') && (char2 <= 'F')){
        char2 = char2 - 'A' + 10;
    }

    return (char1*16) + char2;

}


